import React from "react";
import { Outlet, Route, Routes } from "react-router-dom";
import NavBar from "./NavBar";
import Footer from "./Footer";
import Login from "./Login";

const Project = () => {
  return (
    <>
      <Routes>
        <Route
          path="/"
          element={
            <>
              <NavBar></NavBar>
              <Outlet></Outlet>
              <Footer></Footer>
            </>
          }
        >
            <Route></Route>
            <Route
                path="login"
                element={<Login></Login>}
            ></Route>
        </Route>
      </Routes>
    </>
  );
};

export default Project;
